import Time from './Time.js';
import CurencyChange from './components/walutconv';

<main>
   const app = (
       <>
       <Hello />
       <Time />
       <CurencyChange />
       </>
   )
   </main>
    ReactDOM.render(app, document.getElementById('Root'));
